package org.my.hrank.algorithms.strings.longest_dup_string;

import org.junit.Assert;
import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.junit.runners.Parameterized;

import java.util.Arrays;
import java.util.Collection;

@RunWith(Parameterized.class)
public class LongestDuplicateStringTest {
    private String in;
    private String out;
    private LongestDuplicateString sol;

    public LongestDuplicateStringTest(String in, String out) {
        this.in = in;
        this.out = out;
    }

    @Before
    public void init() {
        sol = new LongestDuplicateString();
    }

    @Parameterized.Parameters
    public static Collection params() {
        return Arrays.asList(new Object[][]{
                {"banana", "ana"},
                {"abcd", ""},
                {"bananabanana", "banana"},
                {"",
                        "akyj"},
                {"",
                        "maoli"},
                {"",
                        "bbqyr"}
        });
    }

    @Test
    public void test() {
        Assert.assertEquals(out, sol.longestDupSubstring(in));
    }
}